    { name: "Books", amount: 87.23, date: new Date(2021, 4, 14) },
    { name: "Gym", amount: 439.08, date: new Date(2021, 6, 15) },
    { name: "Food", amount: 537.90, date: new Date(2021, 7, 22) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
